        "name": "Sabrina Keßler",
        "descriptionDe": "Sabrina Keßler ist Wirtschaftsjournalistin, Volkswirtin und Börsen-Reporterin. Seit 2019 lebt und arbeitet sie in New York. Hier berichtet sie live vom wichtigsten Kapitalmarkt der Welt – der legendären Wall Street – und beweist, dass Börse mindestens so spannend ist wie in den zahlreichen Hollywood-Filmen. Wenn sie nicht vor der Kamera steht (u.a ntv, Deutsche Welle, SRF), reist sie quer durch die USA. Das „echte Amerika“ findet man nämlich selten in New York. Von unterwegs schreibt sie am liebsten Reportagen (NZZ, Börsen-Zeitung) oder bastelt Radiobeiträge (SRF, rbb). Und Podcasts dürfen natürlich auch nicht fehlen. In „Insight Wall Street“ erklärt Sabrina alle zwei Wochen, was die Investoren an der Wall Street wirklich bewegt. Und beim OMR-Klassiker „Ohne Aktien wird schwer“ gibt’s Woche für Woche die spannendsten Stories und Aktien, die die Wall-Street grad bewegen.",
