        "descriptionDe": "Tarek Müller (33) ist Mitgründer, Gesellschafter und Vorstandsmitglied bei ABOUT YOU, eines der am schnellsten wachsenden E-Commerce Unternehmen und größten Mode- und Lifestyle-Plattformen in Europa, welches mit einer Bewertung von knapp vier Milliarden Euro im Juni 2021 an der Frankfurter Börse gelistet wurde. Seit mehr als fünfzehn Jahren entwickelt Müller digitale Geschäftsmodelle für den Online-Handel und verantwortet bei ABOUT YOU die Bereiche Marketing & Brands und ist Geschäftsführer von SCAYLE, der B2B-Division der ABOUT YOU Holding SE.  Der Unternehmer startete mit 13 Jahren seine ersten geschäftlichen Aktivitäten im Internet-Business. Mit 15 Jahren folgte die Gewerbeanmeldung und Gründung erster Online-Shops. Später baute er als geschäftsführender Gesellschafter zahlreiche E-Commerce-Modelle in unterschiedlichen Branchen auf. Ab 2007 gründete er zudem Dienstleistungsunternehmen, um Kunden bei der Konzeption und Umsetzung neuer Geschäftsmodelle zu unterstützen. Seine Agentur Netimpact Framework GmbH entwickelte sich von 2007 bis 2013, mit mehr als 70 Mitarbeitern, zu einer der größeren deutschen Digitalagenturen – zu deren Kunden unter anderem die Otto Group gehörte. Im Juni 2013 übernahm der Konzern das Unternehmen. Daraufhin gründete Müller Anfang 2014 zusammen mit seinen Mitgründern Hannes Wiese und Sebastian Betz den Fashion Online Shop ABOUT YOU. Mit einer konsequenten Fokussierung auf Personalisierung, Inspiration und Mobile-Endgeräte erwirtschaftete das Fashion- und Tech-Unternehmen einen Umsatz von 1,17 Mrd. Euro im siebten Geschäftsjahr 2020/21. ABOUT YOU ist in 26 europäischen Ländern aktiv und bietet außerdem mit SCAYLE eine eigene E-Commerce-Infrastruktur als Lizenzprodukt an. Im Dezember 2019 gründete Müller außerdem die 105 Viertel gGmbH, eine Non-Profit Organisation zur Förderung von Kunst, Kultur und Gemeinschaft in Hamburg.  Tarek Müller, gebürtiger Hamburger, ist außerdem Gründer und Gesellschafter der 2011 gegründeten Beratungsfirma Etribes, sowie der 2018 gegründeten Investmentgesellschaft Wald & Wiese. Darüber hinaus ist Müller als Investor und Business-Angel aktiv. Insgesamt hält er über 15 Firmen-Beteiligungen. Die von ihm zusammen mit Sebastian Betz 2010 ins Leben gerufene Entwickler-Konferenz code.talks in Hamburg zieht jährlich rund 1.800 Teilnehmer und 120 nationale und internationale Speaker an und gilt als die größte Entwickler-Konferenz Europas. 2014 wurde Müller mit dem „e-Star Personality Award“ ausgezeichnet, das Wirtschaftsmagazin Capital wählte ihn 2015 und 2016 unter die „Junge Elite – Top 40 unter 40“; das US-Magazin Forbes zählt Müller in der Liste „30 under 30“ zu den vielversprechendsten Unternehmern Europas und vom SPIEGEL wurde Müller als „einer der erfolgreichsten jungen Online-Unternehmer Deutschlands“ bezeichnet. Das Fachmedium HORIZONT ehrte ihn mit dem Award als „Marketing-Mann des Jahres 2018“ und 2019 wurde er zum „CMO of the Year“ gekürt, der renommierten Auszeichnung von Europas größter Agenturgruppe Serviceplan. Im darauffolgenden Jahr erhielt Müller mit ABOUT YOU den „Marketing Preis 2020“, das Gütesigel des Deutschen Marketing Verbandes.",
        "descriptionEn": "Tarek Müller (33) is co-founder, shareholder and board member at ABOUT YOU, one of the fastest growing e-commerce companies and largest fashion and lifestyle platforms in Europe, which was valued at almost four billion euros in June 2021 with its listing at the Frankfurter stock exchange. Müller has been developing digital business models for online trading for more than fifteen years and is responsible for the areas of marketing & Brands and is Managing Director of SCAYLE, the B2B division of ABOUT YOU Holding SE. The entrepreneur started his first business activities at the age of 13. At the age of 15, he registered his business and founded his first online shop. Later, as managing partner, he built up numerous e-commerce models in various industries. From 2007 to 2013, his agency Netimpact Framework GmbH, with more than 70 employees, developed into one of the larger German digital agencies - whose customers included the Otto Group, among others. At the beginning of 2014, Müller then founded the fashion online shop ABOUT YOU together with his co-founders Hannes Wiese and Sebastian Betz. With a consistent focus on personalization, inspiration and mobile devices, the fashion and tech company generated sales of EUR 1.17 billion in the seventh financial year 2020/21. ABOUT YOU is active in 26 European countries and also offers its own e-commerce infrastructure with SCAYLE as a  licensed product.",
