        "name": "Christoph Burseg",
        "descriptionDe": "Christoph Burseg ist ein echter ,,Online Marketing Junkie\" und ein vertrauter Freund der OMR-Familie. Christoph ist Gründer des Youtube-Analyse-Tools VeeScore.com und ist Spezialist in Sachen frühzeitige Erkennung von Internettrends — vor allem im Bereich Video. Wenn es einen aufstrebenden Channel in der großen, hippen Youtube-Welt gibt – er kennt ihn mit Sicherheit. Christoph ist immer wieder auf „Rockstars“-Events zu sehen und wird stets top bewertet.",
