        "name": "Marcus Merheim",
        "descriptionDe": "Marcus Merheim ist seit mehr als 10 Jahren in der HR-Welt unterwegs und setzt sich dabei aus einer Marketingperspektive mit unterschiedlichsten Personalthemen auseinander. Inhaltlich liegt sein Fokus auf Recruiting und Employer Branding sowie New Work und Digitalisierung. Als Gründer von hooman EMPLOYER MARKETING setzt er an der Schnittstelle von HR und Marketing an. Dabei ist er davon überzeugt, dass Employer Branding seine volle Wirkung als kraftvolles Werkzeug der strategischen Unternehmensführung nur dann entfalten kann, wenn Recruiting & Retention basierend auf einer starken Arbeitgebermarke professionell und vor allem glaubwürdig betrieben werden. Zusätzlich ist Marcus Vorsitzender des Ressorts „Arbeitswelt der Zukunft“ beim Bundesverband Digitale Wirtschaft.",
        "descriptionEn": "Marcus Merheim has been active in the HR space for over a decade, focussing on a variety of HR-related topics from a marketing perspective. When it comes to content, his focus is on recruiting and employer branding as well as new work and digitalization. As the founder of hooman EMPLOYER MARKETING, he focuses on the interface between HR and marketing. ",
