        "name": "Juliane Bock",
        "descriptionDe": "Jule Bock, People Lead bei Heyflow: \"Mit Tech Recruiting hat alles begonnen: Jetzt nenne ich schon seit fast zehn Jahren das gesamtheitliche People Management mit Culture Schwerpunkt mein berufliches Zuhause. Meine Mission ist es, Kolleg*innen und Teams durch intrinsische Motivation zu der Berufung zu führen, die sie verdient haben. Auf dem Weg dahin bringe ich den Human Factor zurück in das zahlenbesessende Personalmanagement und gehe dabei den altruistischen und resilienten Ansatz.\"",
        "descriptionEn": "Jule Bock, People Lead bei Heyflow got her start in tech recruiting, but has spent the better part of the last decade in people management with a focus on culture. Her mission is to use intrinsic motivation to lead colleagues to the calling that they deserve. To this end, she is bringing back the human factor to the numbers-obsessed HR industry and implementing a altruistic and resilient approach.",
