        "name": "Anna Kaiser",
        "descriptionDe": "Digitalisierung, Female Leadership, People Tech und New Work sind einige der Themen, die ihr am Herzen liegen und zu denen sie Akteure in Politik und Wirtschaft berät. Zum Beispiel als Mitglied des Beirats \"Junge Digitale Wirtschaft\" des Bundesministeriums für Wirtschaft und Energie, als Gründungsmitglied des Ethik-Beirats HR-Tech oder als Vorsitzende des Referats \"Zukunft der Arbeit\" beim Bundesverband Digitale Wirtschaft (BVDW e.V.). Mit der Gründung des Tech-Unternehmens Tandemploy im Jahr 2013, dem Investorinnen-Netzwerk encourageventures im Jahr 2021 und dem Zusammenschluss von Tandemploy mit dem globalen Tech-Unternehmen Phenom im Jahr 2022 hat sie mehr als einmal gezeigt, was möglich ist, wenn wir uns trauen, unsere Vorstellungen von einer besseren Arbeitswelt nicht in der Theorie zu belassen, sondern mit Herz und Verstand anzupacken.",
        "descriptionEn": "Digitization, Female Leadership, People Tech and New Work are some of the topics she is passionate about and on which she advises players in politics and business, for example as a member of the Advisory Board \"Young Digital Economy\" of the German Federal Ministry for Economic Affairs and Energy, founding member of the Ethics Advisory Board HR-Tech or chairwoman of the department \"Future of Work\" at the German Federal Association of the Digital Economy (BVDW e.V.). With the founding of the tech company Tandemploy in 2013, the all-female investors' network encourageventures in 2021 and the merger of Tandemploy with the global tech company Phenom in 2022, she has shown more than once what is possible when we dare not to leave our idea of a better working world in theory, but to tackle it with our hearts and minds.",
